        [Fact]
        public void UrlRepository_GenerateUrlForGettingCoursesList_Correct()
        {
            //Arrange
            var repository = new UrlRepository();
            var id = Guid.Parse("511d4dfc-574e-4801-af14-e99dc24f8209");
            var expected = "https://radon.nauka.gov.pl/opendata/polon/courses?resultNumbers=100&leadingInstitutionUuid=511d4dfc-574e-4801-af14-e99dc24f8209";
            //Act
            var result = repository.GenerateUrlForGettingCoursesList(id);
            //assert
            Assert.Equal(expected, result);
        }

        [Fact]
        public void UrlRepository_GenerateUrlForGettingCoursesListWithToken_Correct()
        {
            //Arrange
            var repository = new UrlRepository();
            var id = Guid.Parse("511d4dfc-574e-4801-af14-e99dc24f8209");
            var token = "MTcxNTA3OTAxOTQyMQ==";
            var expected = "https://radon.nauka.gov.pl/opendata/polon/courses?resultNumbers=100&token=MTcxNTA3OTAxOTQyMQ%3D%3D&leadingInstitutionUuid=511d4dfc-574e-4801-af14-e99dc24f8209";
            //Act
            var result = repository.GenerateUrlForGettingCoursesListWithToken(id, token);
            //assert
            Assert.Equal(HttpUtility.UrlDecode(expected), result);
        }

